"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Chronic myeloid leukemia (CML) (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/chronic-myeloid-leukemia-cml-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H13397085\">",
"      <span class=\"h1\">",
"       What is chronic myeloid leukemia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Chronic myeloid leukemia, called &ldquo;CML,&rdquo; is a type of blood cancer. Blood is made up of different types of cells. These cells are made in the middle of your bones, in a part called the bone marrow.",
"     </p>",
"     <p>",
"      People with CML have an abnormal gene in some of their blood cells. This gene causes the bone marrow to make abnormal blood cells. These abnormal blood cells can grow out of control, get into the blood, and travel around the body. Sometimes, these cells collect in certain parts of the body.",
"     </p>",
"     <p>",
"      When the bone marrow makes abnormal blood cells, it does not make enough of the normal blood cells a person&rsquo;s body needs. This can cause symptoms.",
"     </p>",
"     <p>",
"      There are 3 stages, or &ldquo;phases,&rdquo; of CML:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        During the",
"        <strong>",
"         chronic phase",
"        </strong>",
"        , the cancer grows very slowly. Most people are in this phase when their CML is diagnosed. This phase can last for years.",
"       </li>",
"       <li>",
"        During the",
"        <strong>",
"         accelerated phase",
"        </strong>",
"        , the cancer begins to grow faster.",
"       </li>",
"       <li>",
"        During the",
"        <strong>",
"         blast phase",
"        </strong>",
"        , the cancer is fast-growing and can be fatal.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Treatment depends, in part, on the phase of your CML.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H13397092\">",
"      <span class=\"h1\">",
"       What are the symptoms of CML?",
"      </span>",
"      &nbsp;&mdash;&nbsp;CML does not always cause symptoms, especially at first. When it does cause symptoms, the most common ones are:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Feeling very tired and weak",
"       </li>",
"       <li>",
"        Sweating much more than usual, or losing weight without trying to",
"       </li>",
"       <li>",
"        Feeling full after eating a small amount of food",
"       </li>",
"       <li>",
"        Bleeding more easily than normal",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H13397099\">",
"      <span class=\"h1\">",
"       Is there a test for CML?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Your doctor or nurse will talk with you, do an exam, and do blood tests. He or she might also do a bone marrow biopsy. For this test, a doctor takes a very small sample of the bone marrow. Then another doctor will look at the cells under a microscope to see if abnormal (cancer) cells are present.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H13397106\">",
"      <span class=\"h1\">",
"       How is CML treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Doctors can treat CML in different ways. When CML is first diagnosed and in the chronic phase, it is treated with medicines (pills) called &ldquo;tyrosine kinase inhibitors&rdquo; or &ldquo;TKIs.&rdquo; TKIs kill the blood cells that have the CML abnormal gene. When these blood cells are gone, the bone marrow can work normally again. TKIs do not cure CML, but they can control it for many years. If you take a TKI, it is very important to take every single dose. Skipping pills can allow the CML to grow out of control.",
"     </p>",
"     <p>",
"      If people have too many side effects from their TKI, or if their CML starts to grow faster, they can have other treatments. These can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Another TKI &ndash; Different TKIs have different side effects. Also, one TKI might work better to control your CML than another. If one TKI doesn&rsquo;t work for you, another might.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Chemotherapy &ndash; Chemotherapy is the term doctors use to describe a group of medicines that kill cancer cells.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Bone marrow transplant &ndash; This treatment replaces cells in the bone marrow that are killed by chemotherapy or radiation. (Radiation kills cancer cells.) These &ldquo;donor&rdquo; cells can come from another person whose blood matches yours.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        A type of medicine called &ldquo;interferon alpha&rdquo;",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H13397113\">",
"      <span class=\"h1\">",
"       What happens after treatment?",
"      </span>",
"      &nbsp;&mdash;&nbsp;After treatment, your doctor will check you every so often to see if the cancer comes back. Regular follow-ups include talking with your doctor, exams, and blood tests. Sometimes, your doctor will also do a bone marrow biopsy.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H13397120\">",
"      <span class=\"h1\">",
"       What happens if the CML comes back?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If the CML comes back, you might be treated with TKIs, chemotherapy, bone marrow transplant, or other medicines.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H13397127\">",
"      <span class=\"h1\">",
"       What else should I do?",
"      </span>",
"      &nbsp;&mdash;&nbsp;It&rsquo;s important to follow all your doctor&rsquo;s instructions about visits, tests, and treatment. It&rsquo;s also important to talk to your doctor about any side effects or problems you have during treatment.",
"     </p>",
"     <p>",
"      Getting treated for CML involves making many choices, such as what treatment to have and when.",
"     </p>",
"     <p>",
"      Always let your doctors and nurses know how you feel about a treatment. Any time you are offered a treatment, ask:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        What are the benefits of this treatment? Is it likely to help me live longer? Will it reduce or prevent symptoms?",
"       </li>",
"       <li>",
"        What are the downsides to this treatment?",
"       </li>",
"       <li>",
"        Are there other options besides this treatment?",
"       </li>",
"       <li>",
"        What happens if I do not have this treatment?",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H13397134\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
