"  </div>",
"  <div class=\"headingAnchor\" id=\"references\">",
"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?11/58/12197/abstract/1\">",
"      Wallace JL. Nonsteroidal anti-inflammatory drugs and gastroenteropathy: the second hundred years. Gastroenterology 1997; 112:1000.",
"     </a>",
"    </li>",
