var title_f11_58_12203="Medical Rx pain endometriosis";
var content_f11_58_12203=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ENDO%2F69477&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ENDO%2F69477&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Medical treatment for pelvic pain in endometriosis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Advantages",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Avoids risk of damaging pelvic organs during surgery",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Avoids risk of postoperative adhesion formation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Treats implants not visualized during surgery",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Disadvantages",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Side effects of medications",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        High recurrence rates after discontinuation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        No effect on existing adhesions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        No effect on endometriomas",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Treatments involving suppression of ovulation also prevent pregnancy during the treatment period",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        No effect on infertility",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
