var title_f11_58_12204="AML induction regimens";
var content_f11_58_12204=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F78251&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F78251&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Chemotherapy induction regimens for acute myeloid leukemia",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Drugs",
"       </td>",
"       <td class=\"subtitle1\">",
"        Dosing",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comments",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cytarabine",
"        <strong>",
"         plus",
"        </strong>",
"        daunorubicin",
"       </td>",
"       <td>",
"        <strong>",
"         Cytarabine",
"        </strong>",
"        : 100 to 300 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        daily as a continuous infusion for 7 days;",
"        <strong>",
"         Daunorubicin",
"        </strong>",
"        : 60 to 90 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        intravenous push on each of the first 3 days of treatment",
"       </td>",
"       <td>",
"        \"Standard 7+3\" induction regimen resulting in approximately 60 to 80 percent remission rate and acceptable toxicity in patients under 60 years old",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Cytarabine (HDAC)",
"        <strong>",
"         plus",
"        </strong>",
"        daunorubicin",
"       </td>",
"       <td>",
"        <strong>",
"         Cytarabine",
"        </strong>",
"        : 1 to 3 g/m",
"        <sup>",
"         2",
"        </sup>",
"        twice daily for a total of 12 doses;",
"        <strong>",
"         Daunorubicin",
"        </strong>",
"        : 45 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        intravenous push for 3 days following cytarabine",
"       </td>",
"       <td>",
"        Yields a 90 percent remission rate; however, substantial toxicity precludes postremission therapy in a high proportion of patients",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Cytarabine",
"        <strong>",
"         plus",
"        </strong>",
"        idarubicin",
"       </td>",
"       <td>",
"        <strong>",
"         Cytarabine",
"        </strong>",
"        : 100 to 200 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        daily as a continuous infusion for 7 days;",
"        <strong>",
"         Idarubicin",
"        </strong>",
"        : 12 to 13 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        IV push on each of first 3 days of treatment",
"       </td>",
"       <td>",
"        Has produced a greater remission rate (88 versus 70 percent) than cytarabine/daunorubicin in younger patients; appears superior to daunorubicin in patients with hyperleukocytosis; overall survival not clearly superior to \"standard\" regimen",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Overview of common induction therapy regimens for acute myeloid leukemia in younger adults.",
"    <div class=\"footnotes\">",
"     HDAC: high dose cytarabine.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
